import React from 'react';
import {
    Typography,
    Grid,
    Link
} from '@material-ui/core';
import MailIcon from '@material-ui/icons/Mail';
import GitHubIcon from '@material-ui/icons/GitHub';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import CopyrightIcon from '@material-ui/icons/Copyright';

const Footer = () => {
    return ( <
        Grid container direction = "row"
        justify = "center"
        alignItems = "center"
        display = 'flex'
        style = {
            {
                height: '100px',
                backgroundColor: 'rgba(0,0,0,0.7)'
            }
        } >

        <
        Grid item xs = {
            6
        } >
        <
        Typography display = "block"
        justifyContent = "center"
        align = "left"
        style = {
            {
                color: 'white'
            }
        } >
        <
        CopyrightIcon style = {
            {
                color: 'white',
                paddingRight: '10px',
                marginLeft: '30px'
            }
        }
        />
        2020 Andrea Husseiniova <
        /Typography> <
        /Grid>

        <
        Grid item xs = {
            6
        } >
        <
        Typography display = "block"
        justifyContent = "center"
        align = "right"
        style = {
            {
                color: 'white'
            }
        } >
        <
        MailIcon style = {
            {
                color: 'white',
                paddingRight: '10px'
            }
        }
        /> <
        a href = 'https://github.com' > < GitHubIcon style = {
            {
                color: 'white',
                paddingRight: '10px'
            }
        }
        /></a >
        <
        a href = 'https://www.linkedin.com/in/ahusseiniova/' > < LinkedInIcon style = {
            {
                color: 'white',
                marginRight: '30px'
            }
        }
        /></a >
        <
        /Typography> <
        /Grid>

        <
        /Grid >

    )
}

export default Footer;
